import React, { useState, useEffect } from "react";
import APIStored from "../components/API/APIStored";
import axios from "axios";
import { json } from "react-router-dom";

function TestingAPI() {
  const [data, setData] = useState([]);

  useEffect(() => {
    APIStored()
      .then((response) => {
        console.log(JSON.stringify(response.data)); // Check the entire response object
        setData(response.data);
      })
      .catch((error) => console.error("Error", error));
  }, []);

  // console.log(JSON.stringify(data));

  useEffect(() => {
    axios
      .get(`http://localhost:8080/api/account/24`)
      .then((response) => {
        // console.log(
        //   "this is response.data with ID" + JSON.stringify(response.data)
        // );
        console.log(
          JSON.stringify(
            "this is data wth id" + JSON.stringify(response.data.accId)
          )
        ); //as na URL
      })
      .catch((error) => console.log("Error fetching account data:", error));
  });

  console.log(JSON.stringify(data));
  return (
    <div>
      <table border="1">
        <thead>
          <tr>
            <th>ID</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Password</th>
            <th>Mobile</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item.id}>
              <td>{item.id}</td>
              <td>{item.first_Name}</td>
              <td>{item.last_Name}</td>
              <td>{item.email}</td>
              <td>{item.password}</td>
              <td>{item.mobile}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default TestingAPI;

